The Day of the Krypton Man. Part 1 of 6. &quot;The Nature of the Beast!&quot; Guest-starring Lobo. Cameo by the Guardian. Superman safeguards the Kryptonite shards he procured from Bloodsport in a secret location in the Antarctic. Jimmy gets counseling from the Guardian. Lobo is hired to kill the Man of Steel, and an alien from Superman's recent past heads to Earth in search of revenge. Plus, the Main Man meets Bibbo! Story continues in Adventures of Superman (1939-2006) #464.

